    cout<<Sarea(a)<<" ";
    cout<<Carea(a)<<" ";
    cout<<a;
    return 0;
}
int Sarea(int &a){
    return a*=a;}
 int Carea(int &r){
     return r=PI*r*r;
 }

Determine the output of the following code
#include<iostream>
using namespace std;
template <class T>
void Swaping(T &x, T &y) {
    T temp;
    temp = x;
    x = y;
    y = temp;
}
int main() {
    int x=34, y=56;
    Swaping(x, y);
    cout  << x;
    cout << " " << y;
    return 0;
}

